import React from "react";
import { Pane, Heading, Text } from 'evergreen-ui'
import Gallery from "react-grid-gallery";


const Contact = () => {

    return (
        <div>
            <Pane clearfix backgroundColor="black" style={{margin: "15px", opacity: ""}}>
                <Heading>CONTACT ADDRESES</Heading>
  <Pane
    elevation={0}
    float="left"
    backgroundColor="white"
    width={200}
    height={120}
    margin={24}
    display="flex"
    justifyContent="center"
    alignItems="center"
    flexDirection="column"
  >
    <Text>Lagos Office:</Text>
    <Text size={300}>AHCN Tower, Suite 207, CIPM Road, Alausa Ikeja, Lagos</Text>
  </Pane>
  <Pane
    elevation={1}
    float="left"
    width={200}
    height={120}
    margin={24}
    display="flex"
    justifyContent="center"
    alignItems="center"
    flexDirection="column"
  >
    <Text>Abuja Office:</Text>
    <Text size={300}>Goodland Plaza, Bayelsa Court, Gaduwa Estate, Abuja FCT.</Text>
  </Pane>
  <Pane
    elevation={2}
    float="left"
    width={200}
    height={120}
    margin={24}
    display="flex"
    justifyContent="center"
    alignItems="center"
    flexDirection="column"
  >
    <Text>Ota Office:</Text>
    <Text size={300}>Dreamyouth Complex 10 Moruuf Alagbe Road, Atan Ota.</Text>
  </Pane>
  
</Pane>



        </div>
    )
}

export default Contact
